import React from "react";
import { useState } from "react";

const AllProject = ()=>{
    const[projects,setProjects] = useState([]);

    return(
        <div>
             <h1 className="title">All Projects</h1>
             
         
 
             <table className="table">
                 <thead className="tableHeading">
                 <tr>
                     <th>Project Name</th>
                     <th>Project Description</th>
                     <th>Project Requirement</th>
                     <th>Manager Assign Status</th>
                     <th>Manager Name</th>
                     <th>Employee Assign Status</th>
                 </tr>
                 </thead>
                 <tbody className="tableBody">
                     {projects.map((project,index)=>(
                         <tr key={project.emailId} className="tableRow">
                             <td>{project.firstName}</td>
                             <td>{project.lastName}</td>
                             <td>{project.emailId}</td>
                             <td>{project.contactNo}</td>
                             <td>{project.street}</td>
                             
                         </tr>
                         
                     ))}

                    
                 </tbody>
             </table>
             </div>
    );

}

export default AllProject;
